import React from 'react';
import Grid from '../../assets/UiKit/grid/Gird';

interface BeverageModulProps {
  rowsCount: number;
  columnsCount: number;
  bottlesArray: {
    name: string;
    price: number;
  }[];
}

export default function BeverageModul(props: BeverageModulProps) {
  const { bottlesArray } = props;

  return (
    <div>
      <Grid>


      {bottlesArray.map((bottle, index) => {
        return (
          <div key={index}>
            <p>{bottle.name}</p>
            <p>{bottle.price}</p>
          </div>
        );
      })}
      </Grid>
    </div>
  );
}
